import { motion, yoyo} from "framer-motion";
import React from "react";

const ballStyle ={
    width: '1rem',
    height: '1rem',
    borderRadius: '.5rem',
    backgroundColor:'black',
}


const bounceTransition = {
    y: {
      duration: 0.4,
      yoyo: Infinity,
      ease: "easeOut"
    },
    backgroundColor: {
      duration: 0,
      yoyo: Infinity,
      ease: "easeOut",
      repeatDelay: 0.8
    }
  };

export default function BouncingBall() {
    return (
      <div
        style={{
          width: "2rem",
          height: "2rem",
          display: "flex",
          justifyContent: "space-around",
          backgroundColor:'black',
        }}
      >
        <motion.span
          style={ballStyle}
          transition={bounceTransition}
          animate={{
            y: ["100%", "-100%"],
            backgroundColor: ["#ff6699", "#6666ff"]
          }}
        />
      </div>
    );
  }
